import { NavigationContainer } from '@react-navigation/native';
import * as React from 'react'
import ClockInOutScreen from '../../screens/ClockInOutScreen';
import { routes } from '../../routes/index';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';
import DashboardScreen from '../../screens/DashboardScreen/index';
import HistoryScreen from '../../screens/HistoryScreen';
import { Button, Text } from 'react-native-paper';


const Tab = createBottomTabNavigator();

export default function AuthenticatedScreenRouter() {
    return (
        <>
            <NavigationContainer>
                <Tab.Navigator
                  tabBarOptions={{
                    activeTintColor: '#1d59a8',
                    inactiveTintColor: 'grey',
                    labelStyle: { fontSize: 10 },
                    }}                
                >
                    <Tab.Screen name={"Clock"} options={{
                        title: "Clock", tabBarIcon: () => (
                            <MaterialCommunityIcons name="clock"  />
                        ),
                    }} >
                        {(props) => <ClockInOutScreen {...props} />}
                    </Tab.Screen>
                    <Tab.Screen name={"History"} options={{
                        title: "History", tabBarIcon: () => (
                            <MaterialCommunityIcons name="history" size={200}/>
                        ),
                    }} >
                        {(props) => <HistoryScreen {...props} />}
                    </Tab.Screen>
                    <Tab.Screen name={"Dashboard"} options={{
                        title: "Dashboard", tabBarIcon: () => (
                            <MaterialCommunityIcons name="view-dashboard" size={200}/>
                        ),
                    }} >
                        {(props) => <DashboardScreen {...props} />}
                    </Tab.Screen>
                </Tab.Navigator>
            </NavigationContainer>
        </>
    );
}
